import React from "react";
import Shirt from "./Shirt";
import { Link } from "react-router-dom";

const Shoes = (props) => {
  return (
    <>
      {props.shoes.map((shoes, id) => (
        <Link to={`/blogs/${shoes.id}`} className="links">
          <Shirt key={id} shoes={shoes} />
        </Link>
      ))}
    </>
  );
};

export default Shoes;
